import "./App.css";
import Axios from "axios";
import { useState } from "react";

function App() {
  const submitTest = () => {
    Axios.get("http://localhost:4004/", {}).then(() => {
      alert("등록 완료!");
    });
  };
  return (
    <div>
      <form method="post" action="/borad" enctype="multipart/form-data">
        <input type="text" name="title" placeholder="제목" />
        <input type="text" name="content" placeholder="내용" />
        <input type="email" name="email" placeholder="작성자" />
      </form>
      <button onClick={submitTest}>업로드</button>
    </div>
  );
}

export default App;
